    <>
      <Header />
      <h1>People</h1>
      <div className="pplDiv">

      {data.map((people, i) => {
        return (

          <Card className="test"
            style={{
              width: "18rem"}}
            key={i}
          >
            <Card.Body >
              <Card.Title>{people.name}</Card.Title>
              <Card.Text>
                Please click to reveal information about <b>{people.name}</b>
              </Card.Text>
              <Card.Link href="#">Continue</Card.Link>
            </Card.Body>
          </Card>
    );
